import { useQuery,gql } from "@apollo/client";
import DeveloperList from "../components/DeveloperList";

const DEVELOPER_QUERY = gql`
    {
      query{
      getAllDevelopers {
        id
        name
        surname
        userEmail
        games {
        id
          title
          description
          imageURL
          genres{
            name
          }
        }
      }
    }
    }
    `



export default function DevelopersPage()
{
    const developers= useQuery(DEVELOPER_QUERY)
    console.log(developers.data)

    return <DeveloperList developers={developers}/>

}
